import React, { Component } from 'react';
import '../assets/css/alfa_style.css';
import '../assets/css/home.css';
import 'bootstrap/dist/css/bootstrap.min.css';

class CartComponent extends Component {
	constructor() {
		super();
		this.state = {
		};
	}

	switchPage() {
		window.location = "./checkout.js";
	}

	render() {
		return (
			<div id="main">
				<h1 align="center" >Shopping Cart</h1>
				<br />
				<div className="container" >
					<div id="car-brands" className="row">
						<div className="col-sm-6 col-lg-4 p-3 mb-3">
							<a href="alfa_parts.js">
								<div className="item">

								</div>
							</a>
						</div>
					</div>
				</div>
				<div className="form-group" align="center">
					<button type="submit" className="btn btn-success btn-lg btn-block" onClick={this.switchPage.bind()} >Sign in</button>
				</div>
			</div>
		)
	}
}

export default CartComponent;
